body {
    padding: 0;
    margin: 0;
    font-family: Arial, sans-serif;
}

.creative {
    display: block;
    width: 728px;
    height: 90px;
    background-color: #ffffff;
    border: 1px solid #cccccc;
    text-decoration: none;
    overflow: hidden;
}

.creative__image {
    float: left;
    display: block;
}

.creative__content {
    margin: 19px 19px 17px;
    float: left;
    width: 372px;
    height: 50px; 
    overflow: hidden;
}

.creative__title {
    width: 100%;
    font-size: 16px;
    font-weight: 900;
    font-stretch: normal;
    font-style: normal;
    line-height: 1;
    letter-spacing: normal;
    color: #282828;
}

.creative__brand-name {
    font-size: 12px;
    font-weight: normal;
    font-stretch: normal;
    font-style: italic;
    line-height: normal;
    letter-spacing: normal;
    color: #828282;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
}

.creative__call-to-action {
    width: 135px;
    margin-top: 20px;
    padding: 0px 3px;
    text-align: center;
    white-space: nowrap;
    overflow: hidden;
    text-overflow: ellipsis;
    line-height: 44px;
    border-radius: 2px;
    border: solid 2px #3d8deb;
    color: #4a90e2;
    font-size: 14px;
    text-transform: uppercase;
}
